import "./Home.css"
import Cards from "../Cards/Cards";
import SearchBar from "../SearchBar/SearchBar";
import FilterAndOrders from "../FiltersAndOrders/FiltersAndOrders";

const Home = () => {
    return (
        <div className="home">
            <div className="filters">
            <FilterAndOrders/>
            </div>
            <SearchBar/>
            <Cards/>
        </div>
    )
}

export default Home
